export default function SearchBar() {
    return (
        <>
            <button className="search-bar">Where would you like to study today?</button>
            <button className="search-button">
                <img src="../public/images/search-alt-svgrepo-com.svg" alt="Search" />
            </button>
        </>
    );
}
